    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Florida coast after Hurricane Wilma made landfall. The regions photographed range
    from Key West to Sixmile Bend, Florida. The aerial photograph missions were conducted
    by the NOAA Remote Sensing Division the day after Wilma made landfall, October 25
    and concluded October 27. The images were acquired from an altitude of 7,500 feet,
    using an Emerge/Applanix Digital Sensor System (DSS). Over 1000 aerial images were
    obtained during this time period, with most available to view online and download.",nt"license_title":
